h.push(new G.ah("provider","Provider\u662fGoogle I/O 2019\u5927\u4f1a\u5ba3\u5e03\u7684\u5b98\u65b9\u63a8\u8350\u7684\u72b6\u6001\u7ba1\u7406\u65b9\u5f0f","https://github.com/rrousselGit/provider",p,"\n## \u5982\u4f55\u4f7f\u7528\n\n\u6211\u4eec\u5148\u6765\u4f7f\u7528\u5b83\uff0c\u7136\u540e\u5728\u6839\u636e\u7528\u4f8b\u5206\u6790\u6e90\u7801\uff0c\u627e\u5230\u6211\u4eec\u60f3\u8981\u7684\u7b54\u6848\uff0c\u5148\u770b\u4e00\u4e2a\u7b80\u5355\u7684\u4f8b\u5b50\n\n### step 1\n\n\u7b2c\u4e00\u6b65\u5b9a\u4e49\u4e00\u4e2aChangeNotifier\uff0c\u6765\u8d1f\u8d23\u6570\u636e\u7684\u53d8\u5316\u901a\u77e5\n\n```\nclass Counter with ChangeNotifier {\n  int _count = 0;\n\n  int get count => _count;\n\n  void increment() {\n    _count++;\n    notifyListeners();\n  }\n\n}\n```\n\n### step 2\n\n\u7b2c\u4e8c\u6b65\uff0c\u7528ChangeNotifierProvider\u6765\u8ba2\u9605Counter\uff0c\u4e0d\u96be\u731c\u51fa\uff0cChangeNotifierProvider\u80af\u5b9a\u662fInheritedWidget\u7684\u5305\u88c5\u7c7b\uff0c\u8d1f\u8d23\u5c06Counter\u7684\u72b6\u6001\u5171\u4eab\u7ed9\u5b50Widget\uff0c\u6211\u8fd9\u91cc\u5c06ChangeNotifierProvider\u653e\u5230\u4e86Main\u51fd\u6570\u4e2d\uff0c\u5e76\u5728\u6574\u4e2aWidget\u6811\u7684\u9876\u7aef\uff0c\u5f53\u7136\u8fd9\u91cc\u662f\u4e2a\u7b80\u5355\u7684\u4f8b\u5b50\uff0c\u6211\u8fd9\u4e48\u5199\u95ee\u9898\u4e0d\u5927\uff0c\u4f46\u4f60\u8981\u8003\u8651\uff0c\u5982\u679c\u662f\u7279\u522b\u5c40\u90e8\u7684\u72b6\u6001\uff0c\u8bf7\u5c06ChangeNotifierProvider\u653e\u5230\u5c40\u90e8\u7684\u5730\u65b9\u800c\u4e0d\u662f\u5168\u5c40\uff0c\u5e0c\u671b\u4f60\u80fd\u660e\u767d\u6211\u7684\u7528\u610f\n\n```\nvoid main() {\n  runApp(\n    /// Providers are above [MyApp] instead of inside it, so that tests\n    /// can use [MyApp] while mocking the providers\n    MultiProvider(\n      providers: [\n        ChangeNotifierProvider(create: (_) => Counter()),\n      ],\n      child: MyApp(),\n    ),\n  );\n}\n```\n\n### step 3\n\n\u7b2c\u4e09\u6b65\uff0c\u63a5\u6536\u6570\u636e\u901a\u8fc7Consumer<Counter>\uff0cConsumer\u662f\u4e2a\u6d88\u8d39\u8005\uff0c\u5b83\u8d1f\u8d23\u6d88\u8d39ChangeNotifierProvider\u751f\u4ea7\u7684\u6570\u636e\n\n```\nclass MyApp extends StatelessWidget {\n  @override\n  Widget build(BuildContext context) {\n    return const MaterialApp(\n      home: MyHomePage(),\n    );\n  }\n}\n\nclass MyHomePage extends StatelessWidget {\n  const MyHomePage({Key key}) : super(key: key);\n\n  @override\n  Widget build(BuildContext context) {\n    print('MyHomePage build');\n    return Scaffold(\n      appBar: AppBar(\n        title: const Text('Example'),\n      ),\n      body: Center(\n        child: Column(\n          mainAxisSize: MainAxisSize.min,\n          mainAxisAlignment: MainAxisAlignment.center,\n          children: <Widget>[\n            const Text('You have pushed the button this many times:'),\n\n            /// Extracted as a separate widget for performance optimization.\n            /// As a separate widget, it will rebuild independently from [MyHomePage].\n            ///\n            /// This is totally optional (and rarely needed).\n            /// Similarly, we could also use [Consumer] or [Selector].\n            Consumer<Counter>(\n              builder: (BuildContext context, Counter value, Widget child) {\n                return Text('{value.count}');\n              },\n            ),\n            OtherWidget(),\n            const OtherWidget2()\n          ],\n        ),\n      ),\n      floatingActionButton: FloatingActionButton(\n        /// Calls `context.read` instead of `context.watch` so that it does not rebuild\n        /// when [Counter] changes.\n        onPressed: () => context.read<Counter>().increment(),\n        tooltip: 'Increment',\n        child: const Icon(Icons.add),\n      ),\n    );\n  }\n}\n```\n",H.a([new G.ah(o,"A wrapper around InheritedWidget to make them easier to use and more reusable.","https://pub.dev/packages/provider",n,p,p),new G.ah("i\u6821\u957f","Flutter Provider \u8fc4\u4eca\u4e3a\u6b62\u6700\u6df1\u3001\u6700\u5168\u3001\u6700\u65b0\u7684\u6e90\u7801\u5206\u6790","https://www.jianshu.com/p/bf2f33b2b5ef",m,p,p)],i)))
